import React from 'react';

function RoomCard({ room }) {
  return (
    <div className="room-card">
      <img src={room.image} alt={room.name} />
      <h2>{room.name}</h2>
      <p>{room.description}</p>
      <p>Price: ${room.price}</p>
      <button>Book Now</button>
    </div>
  );
}

export default RoomCard;
